    var OpenedWindow;
    //Pop up window function with site content
    function PopOut(nextFct) {
        if (OpenedWindow) {
            $("#msg-divB").animate({ top: "-602px" }, 200, function () {
                $(OpenedWindow).hide(0, "linear", nextFct);
                //			OpenedWindow = undefined;
            });
        }
        else

    }

    var currentWidth;
    var winWidth;
    function resizeWindow(theDiv) {
        currentWidth = $("#winB-div").width();
        var lastWinWidth = $("#" + theDiv).width() + 10;
        if (lastWinWidth != winWidth) {
            winWidth = lastWinWidth;
            var position = currentWidth - winWidth - 10;
            //$("#msg-divB").css({ left: position + "px", width: winWidth + "px", top: "-1602px" });
            $("#msg-divB").css({ left: "20px", top: "-1602px" });
        }
    }

    function PopUp(theDiv) {
        PopOut(function () {
            resizeWindow(theDiv);
            //$("#msg-divB").css({ left: "10px", width: "100%", top: "-1602px" });

            OpenedWindow = "#" + theDiv;
            $(OpenedWindow).show(0, "linear", function () {
                $("#msg-divB").animate({ top: "20px" }, 1024);
            });
        });
    }

    //empty callback function. Can be used to know when the message window is hidden
    function callback() { };

    //hides currently displayed message window
    function HideWindow() {
        PopOut(callback);
    }

    //Function called when a click occured in a circle. The Node param is the Node object.
    function OpenWindow(theDiv) {
        if (theDiv && OpenedWindow != "#" + theDiv) 
        {
            $("#msg-divB").clearQueue();
            PopUp(theDiv);
        }
    }

    function isCanvasSupported() {
        var elem = document.createElement('canvas');
        return !!(elem.getContext && elem.getContext('2d'));
    }

</script>

                var data = { Type: "Register", Name: "admin" }; //Register

                if (stepCounter == 1) {
                    var data = { Type: "Menu", Message: "" }; //Get menu options
                    conn.send(JSON.stringify(data));
                }//*/
            };

            conn.onerror = function (event) {
                var response;
                if(event.data)
                    response = JSON.parse(event.data);
                if (response && response.Message)
                    Terminal.echo(response.Message);
                else
                    Terminal.echo("Web Socket Error");
            };

            conn.onclose = function (event) {
                var response;
                if (event.data)
                    response = JSON.parse(event.data);
                if (response && response.Message)
                    Terminal.echo(response.Message);
                else
                    Terminal.echo("Web Socket Closed");
            };
        }
    }
